import React,{useState} from 'react';
import Home from "./components/Sidebar/Home";
import './App.css';
import {BrowserRouter as Router,NavLink} from 'react-router-dom'
import {Route} from 'react-router-dom'
import Notification from "./components/Sidebar/Notification";
import TradeI from "./components/Sidebar/Trade_I";
import TariffM from "./components/Sidebar/Tariff_M";
import NonTariffM from "./components/Sidebar/NonTariff_M";
import Commodity from "./components/Sidebar/Commodity";
import CaseS from "./components/Sidebar/Case_S";
import Blog from "./components/Sidebar/Blog";
import Report from "./components/Sidebar/Report";
import Sidebar from "./components/Sidebar";

const App=({Children})=> {
    const [sidebarOpen,setSidebarOpen]=useState(false);
    const openHandler=()=>{
        if(!sidebarOpen){
            setSidebarOpen(true);
        }
        else{
            setSidebarOpen(false);
        }
    }
    let sidebar
    if(sidebarOpen)
    {
        sidebar=<Sidebar click={openHandler}/>
    }
  return (
      <Router>
          {Sidebar}
          <div  className="page">
            <Route exact strict path="/" component={Home}/>
            <Route exact strict path="/notification" component={Notification}/>
            <Route exact strict path="/trade_i" component={TradeI}/>
            <Route exact strict path="/tariff_m" component={TariffM}/>
            <Route exact strict path="/nontariff_m" component={NonTariffM}/>
            <Route exact strict path="/commodity" component={Commodity}/>
            <Route exact strict path="/case_s" component={CaseS}/>
            <Route exact strict path="/blog" component={Blog}/>
            <Route exact strict path="/report" component={Report}/>
          </div>
      </Router>
  );
}

export default App;
